import React from 'react';
import './App.css';
import Navbar from './components/navigation';
import './components/text_animation';
import AnimateText from './components/text_animation';
import CircleAnimation, { LineAnimation2 } from './components/shapes';
import { LineAnimation } from './components/shapes';

function App() {
  return (
    <div className="App">

      <header className="App-header">
        <link rel="stylesheet" href="https://fonts.googleapis.com/css2?family=Abhaya+Libre:wght@400;700&display=swap"></link>


        {/*this is a comment*/}
        <div className="line-container">      
          <LineAnimation x1="0" y1="50%" x2="50%" y2="0%"/>
        </div>
        <div className="line-container">      
          <LineAnimation x1="100%" y1="50%" x2="50%" y2="100%"/>
        </div>
        <div className="line-container">      
          <LineAnimation x1="50%" y1="0%" x2="0%" y2="150%"/>
        </div>
        <div className="line-container">      
          <LineAnimation x1="100%" y1="50%" x2="50%" y2="100%"/>
        </div>


        <strong class="header-introduction"><AnimateText/></strong>
        <p class='header-information'>CS undergraduate at <a class="link-gatech" target="_blank" rel="noopener noreferrer" href="https://www.gatech.edu/">
            <strong>Georgia Tech</strong>
            </a>
        </p>
        <Navbar/>
      </header>
    </div> 
  );
}
export default App;
